import React from "react";
import { NavLink } from "react-router-dom";

export function Pokemon({ name, img, types, attack, id }) {
  return (
    <div>
      <NavLink to={`pokemons/${id}`}>
        <h1>{name}</h1>

        <img src={img} alt="img" />
        <p>{types}</p>
      </NavLink>
    </div>
  );
}
export default Pokemon;
